import { Route, Routes } from "react-router";

import { BrowserRouter } from "react-router-dom"
import Clock from "./Clock"
import Radio from "./Radio"

// const navStyle = {
//   color: "red",
//   backgroundcolor: "black",
// }

class NavBar extends Component {
  render() {
    return (
      <BrowserRouter>

          <nav>
            <ul>
              <li>

              </li>
              <li>

              </li>
            </ul>
            {/* <a className="navbar-brand" href="/#Clock">
            Clock
          </a>
          <a className="navbar-brand" href="/#Radio">
            Radio
          </a> */}
          </nav>

            <Routes>
            <Route path="/">
              <Clock />
            </Route>
            <Route path="/radio">
              <Radio />
            </Route>
</Routes>  

      </BrowserRouter>
    )
  }
}

export default NavBar
